{"query":"mutation ReadAssetMutation(
  $read: AssetReadInput!
) {
  assetRead(read: $read) {
    error {
      message
      type
    }
    reference {
      shortlistId
      readingHistoryId
      shortlistItem {
        assetId
        id
      }
      assetEdge {
        cursor
        node {
          ...ShortlistAssetFragmentFragment
          id
        }
      }
    }
  }
}

fragment ShortlistAssetFragmentFragment on Asset {
  asset {
    headlines {
      headline
    }
  }
  assetType
  featuredImages {
    landscape3x2 {
      ...ImageFragment
    }
    square1x1 {
      ...ImageFragment
    }
  }
  id
  urls {
    canonical {
      path
      brand
    }
    published {
      brisbanetimes {
        path
      }
      canberratimes {
        path
      }
      smh {
        path
      }
      theage {
        path
      }
      watoday {
        path
      }
    }
  }
}

fragment ImageFragment on Image {
  data {
    animated
    aspect
    autocrop
    cropWidth
    id
    mimeType
    offsetX
    offsetY
    zoom
  }
}
","variables":{"read":{"assetId":"ujnn","deviceId":"e47cbb6b-1f3a-4329-91c8-08a4e6289a4f"}}}
